import React, { useState } from "react";
import {
  Dialog,
  DialogContent,
  DialogHeader,
  DialogTitle,
  DialogTrigger,
} from "@/components/ui/dialog";
import { Button } from "@/components/ui/button";
import { Download, FileText, FileSpreadsheet } from "lucide-react";
import { Solicitacao } from "@/types/solicitacao";
import { gerarRelatorioPDF, gerarRelatorioXLSX, getLogoBase64 } from "@/lib/relatorioUtils";

interface DownloadDialogProps {
  solicitacoes: Solicitacao[];
  currentFilter: string;
  startDate?: string | null;
  endDate?: string | null;
}

// Configuration for the surprise image feature
const SURPRISE_CONFIG = {
  CHANCE: 0.001, 
 
  IMAGE_BASE64: "data:image/png;base64,",
  
  DURATION: 3000, // millisegundos
};

export const DownloadDialog: React.FC<DownloadDialogProps> = ({
  solicitacoes,
  currentFilter,
  startDate,
  endDate,
}) => {
  const [isOpen, setIsOpen] = useState(false);
  const [isDownloading, setIsDownloading] = useState(false);
  const [showSurprise, setShowSurprise] = useState(false);

  const handleDownload = async (format: "pdf" | "xlsx") => {
    try {
      setIsDownloading(true);
      
      // Show surprise image based on chance
      if (Math.random() < SURPRISE_CONFIG.CHANCE) {
        setShowSurprise(true);
        setTimeout(() => setShowSurprise(false), SURPRISE_CONFIG.DURATION);
      }

      const filteredSolicitacoes = solicitacoes;
      
      if (format === "pdf") {
        const logoBase64 = await getLogoBase64();
        await gerarRelatorioPDF({
          solicitacoes: filteredSolicitacoes,
          status: currentFilter,
          filtroDescricao: `${filteredSolicitacoes.length} solicitações`,
          titulo: "R3 Suprimentos",
          subtitulo: "Relatório de Solicitações",
          logoBase64,
          startDate,
          endDate,
        });
      } else {
        gerarRelatorioXLSX({
          solicitacoes: filteredSolicitacoes,
        });
      }

      setIsOpen(false);
    } catch (error) {
      console.error("Erro ao gerar relatório:", error);
      alert("Erro ao gerar relatório. Tente novamente.");
    } finally {
      setIsDownloading(false);
    }
  };

  return (
    <>
      {/* Surprise Image Overlay */}
      {showSurprise && (
        <div className="fixed inset-0 z-[9999] bg-black/50 flex items-center justify-center pointer-events-none">
          <div className="bg-white rounded-lg p-8 shadow-2xl animate-bounce">
            {/* eslint-disable-next-line @next/next/no-img-element */}
            <img 
              src={SURPRISE_CONFIG.IMAGE_BASE64} 
              alt="Surprise!" 
              className="w-32 h-32 mx-auto"
            />
            <p className="text-center mt-4 text-xl font-bold text-gray-800">
              🎉 Relatório baixado com sucesso! 🎉
            </p>
          </div>
        </div>
      )}

      <Dialog open={isOpen} onOpenChange={setIsOpen}>
        <DialogTrigger asChild>
          <Button className="bg-green-600 hover:bg-green-700 text-white h-10 cursor-pointer">
            <Download className="h-4 w-4 mr-2" />
            Relatório
          </Button>
        </DialogTrigger>
        <DialogContent className="bg-slate-800 border-slate-700 text-white">
          <DialogHeader>
            <DialogTitle className="flex items-center gap-2">
              <Download className="h-5 w-5" />
              Baixar Relatório
            </DialogTitle>
            <div className="text-slate-400">
              Escolha o formato do relatório que deseja baixar.
              <br />
              <span className="text-sm">
                {solicitacoes.length} solicitações serão incluídas (filtro atual: {currentFilter})
              </span>
            </div>
          </DialogHeader>

          <div className="flex flex-col gap-3 mt-4">
            <Button
              onClick={() => handleDownload("pdf")}
              disabled={isDownloading}
              className="bg-red-600 hover:bg-red-700 text-white h-12 flex items-center justify-start gap-3"
            >
              <FileText className="h-5 w-5" />
              <div className="flex flex-col items-start">
                <span className="font-medium">Baixar PDF</span>
                <span className="text-xs opacity-80">Documento formatado para impressão</span>
              </div>
            </Button>

            <Button
              onClick={() => handleDownload("xlsx")}
              disabled={isDownloading}
              className="bg-green-600 hover:bg-green-700 text-white h-12 flex items-center justify-start gap-3"
            >
              <FileSpreadsheet className="h-5 w-5" />
              <div className="flex flex-col items-start">
                <span className="font-medium">Baixar Excel</span>
                <span className="text-xs opacity-80">Planilha editável com filtros</span>
              </div>
            </Button>

            {isDownloading && (
              <div className="text-center text-slate-400 mt-2">
                <div className="inline-flex items-center gap-2">
                  <div className="animate-spin rounded-full h-4 w-4 border-2 border-slate-400 border-t-transparent"></div>
                  Gerando relatório...
                </div>
              </div>
            )}
          </div>

          <div className="mt-4 p-3 bg-slate-700/50 rounded-lg">
            <p className="text-xs text-slate-400">
              💡 <strong>Dica:</strong> O relatório incluirá apenas as solicitações que correspondem ao filtro atual.
              Para incluir todas as solicitações, selecione &quot;Todos&quot; no filtro de status antes de baixar.
            </p>
          </div>
        </DialogContent>
      </Dialog>
    </>
  );
};
